import React from "react";
import "antd/dist/antd.css";
import { Menu } from "antd";
import { DesktopOutlined, DashboardOutlined } from "@ant-design/icons";
import DeviceManagementApp from "../DeviceManagement";
import { Routes } from "react-router";

class NavigationMenu extends React.Component {
  state = {
    current: "Home",
  };

  handleClick = (e) => {
    console.log("click ", e);
    this.setState({ current: e.key });
  };

  render() {
    const { current } = this.state;
    return (
      <Menu
        onClick={this.handleClick}
        selectedKeys={[current]}
        mode="horizontal"
      >
        <Menu.Item key="Home" icon={<DesktopOutlined />}>
          Navigation One
        </Menu.Item>
        <Menu.Item key="Tester" icon={<DashboardOutlined />}>
          <Routes>
            <Route path="Devices" component={DeviceManagementApp} />
          </Routes>
        </Menu.Item>
        <Menu.Item key="Dashboard" icon={<DashboardOutlined />}>
          Navigation Two
        </Menu.Item>
      </Menu>
    );
  }
}

export default NavigationMenu;
